import './App.css';
import App from './App';
import AppAlphabets from './AppAlphabets';
import SideBar from './SideBar';


function Container() {
  return (
    <div className="app">
      <SideBar/>
      <div className="container">
        <div id='dragdrop' style={{textAlign: 'center'}}> Drag Drop
          <App/>
          <AppAlphabets/>
        </div>
        <div id='forms'> Forms

        </div>
      </div>

    </div>
  );
}

export default Container;
